import React from 'react';
import logo from './logo.svg';
import './App.css';
import HJETlogo from './HJETlogo.jpg';
import LoginBox from './LoginBox.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h3>Login</h3>
        <img src={HJETlogo} />
        <LoginBox />
      </header>
    </div>
  );
}

export default App;
